import { Grid, Typography } from "@material-ui/core";
import React from "react";

const Welcome = (props) => {
  const playHtml = `
    <!DOCTYPE html>
    <html lang="en">
      <head>
        <meta charset="UTF-8">
        <meta http-equiv="X-UA-Compatible" content="IE=edge">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <title>auto play video</title>
      </head>
      <body>
        <video autoplay loop muted src="video.mp4"></video>
      </body>
      <style>
        * {
          margin: 0;
          padding: 0;
          box-sizing: border-box;
        }
        video {
          width: 100%;
        }
      </style>
    </html>
  `;

  return (
    <Grid
      container
      item
      direction="column"
      alignItems="center"
      justify="center"
      style={{ padding: "30px", minHeight: "93vh" }}
    >
      <Grid item>
        <Typography variant="h2">Welcome to Job Portal</Typography>
      </Grid>
      <Grid item dangerouslySetInnerHTML={{ __html: playHtml }} />
    </Grid>
  );
};

export const ErrorPage = (props) => {
  return (
    <Grid
      container
      item
      direction="column"
      alignItems="center"
      justify="center"
      style={{ padding: "30px", minHeight: "93vh" }}
    >
      <Grid item>
        <Typography variant="h2">Error 404</Typography>
      </Grid>
    </Grid>
  );
};

export default Welcome;
